// src/services/api.js
export function fetchUserByDOB(dob) {
    return fetch(`/api/user?dob=${dob}`)
      .then((response) => response.json())
      .then((data) => data);
  }

  // Or, if it's a default export:
  // export default { fetchUserByDOB };
